import React from "react";
import { useParams } from "react-router-dom";

const Contact = ({match}) =>{
  const fname = useParams();
    return (
        <>
          <h1> this is my mobile number 9904284492 {match.params.fname} </h1>
        </>
    )
}

export default Contact;
